import React from 'react';
import './Projects.css';
import project1 from '../assets/Project1.png';
import project2 from '../assets/Project2.png';
import project3 from '../assets/Project3.png';

function Projects() {
    const projectData = [
        {
            title: 'Basic Age Calculator',
            image: 'project1',
            livelink: 'https://yourportfolio.com',
            description: 'A personal website showcasing my skills, resume, and contact details',
            caseStudy: 'Built with HTML, CSS, JavaScipt. Faced challenges with the '
        }
    ]

    return(
        <section className="projects">
            <h2>Projects</h2>
            <ul>
                <li>A Number Guessing Game</li>
                <li>Battery Percentage Indicator</li>
                <li>Calculator App</li>
            </ul>
        </section>
    );
}

export default Projects;
